import React, { Component,  } from "react";
class Button extends Component {
  constructor() {
    super();
    this.state = { number: 0 };
    this.clickEvent = this.clickEvent.bind(this);
  }
  clickEvent() {
    this.setState((previousNumber) => {
      return { number: previousNumber + 1 };
    });
  }
  render() {
    return (
        <div>
         <h1>hello</h1>   
     </div>
    );
  }
}
export default Button;
